import React from 'react'

const SideMenu = () => {
  return (
    <div className='side_menu_box'>
        <ul className='side_menu_list'>
            <li className='side_menu_menu menu11'>리스트</li>
            <li className='side_menu_menu menu22'>챗창</li>
            <li className='side_menu_menu menu33'>설정</li>
        </ul>
    </div>
  )
}

export default SideMenu
